function PrimaryButton(props) {
  const buttonStyle = {
    backgroundColor: "#ff751f",
    border: "2px solid #ff751f",
    color: "white",
    padding: ".5em 1em .5em 1em",
    fontWeight: "550",
    marginRi
  };
  return (
    <>
      <button style={buttonStyle}>{props.text}</button>
    </>
  );
}

export default PrimaryButton;
